	(1,'<p><span style=\"font-size:20px\"><strong>ขั้นตอนการสั่งซื้อสินค้า</strong></span></p>\n\n<p><strong><span style=\"font-size:16px\">1. เข้าสู่ระบบ</span></strong></p>\n\n<p><img alt=\"\" src=\"http://localhost/shopping_cart/uploads/ck_imagesimages/howto-1.jpg\" style=\"height:348px; width:590px\" /></p>\n\n<hr />\n<p><span style=\"font-size:16px\"><strong>2. เลือกรายการสินค้าของท่านแล้วกดปุ่ม </strong><span style=\"color:#FF0000\"><strong><em>&quot;หยิบใส่ตระกร้า&quot;</em></strong></span></span></p>\n\n<p><img alt=\"\" src=\"http://localhost/shopping_cart/uploads/ck_imagesimages/howto2.jpg\" style=\"height:375px; width:400px\" /></p>\n\n<hr />\n<p><span style=\"font-size:16px\"><strong>3. กดที่ตระกร้าสินค้ามุมขวามือด้านบน&nbsp;</strong></span><strong><img alt=\"\" src=\"http://localhost/shopping_cart/uploads/ck_imagesimages/howto3-1.jpg\" style=\"height:75px; width:97px\" />&nbsp;</strong><span style=\"font-size:16px\"><strong>จะแสดงรายการสินค้าของท่านจาก</strong><strong>นั้นกดปุ่ม </strong><span style=\"color:#FF0000\"><em><strong>&quot;ยืนยันการสั่งซื้อสินค้า&quot;</strong></em></span></span></p>\n\n<p><strong>&nbsp;<img alt=\"\" src=\"http://localhost/shopping_cart/uploads/ck_imagesimages/howto3-2.jpg\" style=\"height:212px; width:286px\" /></strong></p>\n\n<p><span style=\"font-size:16px\"><strong>หรือ กดดูรายการสินค้า&nbsp;</strong></span></p>\n\n<p><strong><img alt=\"\" src=\"http://localhost/shopping_cart/uploads/ck_imagesimages/howto3-3.jpg\" style=\"height:330px; width:631px\" /></strong></p>\n\n<hr />\n<p><span style=\"font-size:16px\"><strong>4. ตรวจสอบรายการสินค้า เลือกวิธีการจัดส่งสินค้า&nbsp;และตรวจสอบที่อยู่ในการจัดส่งจากนั้นกดปุ่ม <span style=\"color:#FF0000\"><em>&quot;ยืนยันการสั่งซื้อสินค้า&quot;</em></span></strong></span></p>\n\n<p><span style=\"font-size:16px\"><strong><span style=\"color:#FF0000\"><em><img alt=\"\" src=\"http://localhost/shopping_cart/uploads/ck_imagesimages/howto4-1.jpg\" style=\"height:563px; width:868px\" /></em></span></strong></span></p>\n\n<p><span style=\"font-size:16px\"><strong><span style=\"color:#FF0000\"><em><img alt=\"\" src=\"http://localhost/shopping_cart/uploads/ck_imagesimages/howto4-2.jpg\" style=\"height:553px; width:865px\" /></em></span></strong></span></p>\n\n<hr />\n<p><span style=\"color:#000000\"><span style=\"font-size:16px\"><strong>5.</strong></span></span><span style=\"font-size:16px\"><strong><em>&nbsp;</em>แจ้งชำระยอดเงินค่าสินค้า</strong></span></p>\n\n<p><span style=\"font-size:16px\"><strong><img alt=\"\" src=\"http://localhost/shopping_cart/uploads/ck_imagesimages/howto5-1.jpg\" style=\"height:375px; width:829px\" /></strong></span></p>\n\n<p><span style=\"font-size:16px\"><strong><img alt=\"\" src=\"http://localhost/shopping_cart/uploads/ck_imagesimages/howto5-2.jpg\" style=\"height:447px; width:874px\" /></strong></span></p>\n\n<p><span style=\"font-size:16px\"><strong><img alt=\"\" src=\"http://localhost/shopping_cart/uploads/ck_imagesimages/howto7.jpg\" style=\"height:567px; width:721px\" /></strong></span></p>\n\n<hr />\n<p><span style=\"color:#008000\"><span style=\"font-size:16px\"><strong>+++ เสร็จสิ้นกระบวนการสั่งซื้อสินค้า +++</strong></span></span></p>\n\n<p>&nbsp;</p>\n');
